export function getWeatherIcon(id) {
  switch (id) {
    case 0:
      return clearWeatherIcon;
    case 1:
      return partlyCloudyWeatherIcon;
    case 2:
      return overcastWeatherIcon;
    case 3:
      return rainyWeatherIcon;
    case 4:
      return snowWeatherIcon;
    case 5:
      return windyWeatherIcon;
    case 6:
      return fogWeatherIcon;
    default:
      return html``;
  }
}
